import React from "react";
import Header from "../Header/Header";
import RegisterDiv from "../Body/RegisterDiv";
import './style.css'
import {
    Switch,
    Route,
    Link,
    Redirect
} from 'react-router-dom';

function MainDiv() {
    return (
        <div id='mainDiv'>
            <Header />
            <Switch>
                <Route path='/Body/RegisterDiv' component={RegisterDiv} />
                <Redirect from='/Body/RegisterDiv' to='/Body/RegisterDiv' />
            </Switch>
        </div>
    )
}

export default MainDiv
